// 定义全局变量
var canvas = document.getElementById('myCanvas');
var ctx = canvas.getContext('2d');
var particles = [];
var particleCount = 100;
var mouse = {
    x: canvas.width / 2,
    y: canvas.height / 2,
    radius: 100
};

// 调整画布大小以适应窗口
function resizeCanvas() {
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;
    mouse.x = canvas.width / 2;
    mouse.y = canvas.height / 2;
}

// 粒子类
function Particle(x, y) {
    this.x = x;
    this.y = y;
    this.size = Math.random() * 5 + 1;
    this.speedX = Math.random() * 3 - 1.5;
    this.speedY = Math.random() * 3 - 1.5;
    this.color = 'rgba(255,255,255,' + (Math.random() * 0.5 + 0.5) + ')';
}

Particle.prototype.update = function() {
    this.x += this.speedX;
    this.y += this.speedY;
    if (this.x < 0 || this.x > canvas.width) this.speedX = -this.speedX;
    if (this.y < 0 || this.y > canvas.height) this.speedY = -this.speedY;

    // 鼠标交互
    var dx = mouse.x - this.x;
    var dy = mouse.y - this.y;
    var distance = Math.sqrt(dx * dx + dy * dy);
    if (distance < mouse.radius) {
        var forceDirectionX = dx / distance;
        var forceDirectionY = dy / distance;
        var force = (mouse.radius - distance) / mouse.radius;
        this.speedX += forceDirectionX * force * 5;
        this.speedY += forceDirectionY * force * 5;
    }

    // 限制速度
    var speed = Math.sqrt(this.speedX * this.speedX + this.speedY * this.speedY);
    if (speed > 5) {
        this.speedX = this.speedX / speed * 5;
        this.speedY = this.speedY / speed * 5;
    }
};

Particle.prototype.draw = function() {
    ctx.fillStyle = this.color;
    ctx.beginPath();
    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
    ctx.fill();
};

// 初始化粒子
function init() {
    particles = [];
    for (var i = 0; i < particleCount; i++) {
        var x = Math.random() * canvas.width;
        var y = Math.random() * canvas.height;
        particles.push(new Particle(x, y));
    }
}

// 动画循环
function animate() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    for (var i = 0; i < particles.length; i++) {
        particles[i].update();
        particles[i].draw();
    }
    requestAnimationFrame(animate);
}

// 鼠标移动事件
canvas.addEventListener('mousemove', function(event) {
    mouse.x = event.x;
    mouse.y = event.y;
});

// 窗口大小改变事件
window.addEventListener('resize', function() {
    resizeCanvas();
    init();
});

// 启动
resizeCanvas();
init();
animate();
